INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (169, '₱', 'Peso', 'Philippine peso', '1898', NULL, NULL, NULL, 'It was a continuation of the colonial Spanish denomination, "Peso Fuerte", without "Fuerte" ', 'Pesos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (66, '$', 'Peso', 'Dominican peso', '1937', NULL, NULL, NULL, 'The peso oro was first introduced as a local coinage in 1937. No paper money was made and US notes continued to circulate as the U.S. dollar was officially the national currency. Only in 1947 were the first peso oro notes issued by the Central Bank.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (279, NULL, 'Silver Escudo', 'Silver Escudo', '1864', '1868', 72, 0.4, 'The silver escudo was one of the currencies of Spain between 1864 and 1869. Some coins and banknotes were produced up to 1873. It was subdivided into 100 céntimos de escudo. The escudo replaced the real de vellon at a rate of 10 reales de vellon = 1 escudo.', 'Silver Escudos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (280, NULL, 'Real de Vellon', 'Real de Vellon', '1600', '1864', 279, 10, 'The Real de Vellón was introduced in 1600 (made of billon, or less than half silver). In 1737 was fixed at ​1⁄20 dollar and equal to 34 maravedíes. Hence 1 Spanish Dollar = 8 Reales = 20 Reales de Vellon = 680 Maravedíes. The Dollar was also called "Real de a 8", "Peso Fuerte" or "Peso Duro". "Peso" was also used as one half of a "Peso Fuerte", equivalent in value to 10 Reales de Vellon (or "1 Real de a 4"). These units were inuse especially for silver coins. Another unit used in parallel was the Escudo or golden Escudo, which was commonly used for the golden coins. It''s value was 16 Reales or 2 Pesos Duros or 40 Reales de Vellon. 
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (283, NULL, 'Peso Fuerte', 'Dominican peso fuerte', '1861', '1865', NULL, NULL, 'Issued during the Spanish occupation between the first and the second republic', 'Pesos Fuertes');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (2, NULL, 'Peso', 'Dominican peso', '1848', '1905', NULL, NULL, 'The U.S. dollar was officially the national currency after the Peso was discontinued', 'Pesos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (284, '$', 'Dollar', 'Puerto Rican dollar', '1899', '1916', NULL, NULL, 'The Puerto Rican Dollar was initially a continuation of the Spanish Peso. Only in the  last issue in 1909 the word Peso was not shown,', 'Dollars');
