INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (10, 72, 'Spanish State, last issue', 1973, 1974, 1, NULL, 'The issue contains all the 3 available denominations. Last issue under Dictator Franco''s rule.', NULL);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (6, 74, 'Second Series (Europa)', 2013, NULL, 2, NULL, 'Same themes as the first series, but redesigned. The 100 € and 200 € notes are slightly smaller and have the same height as the 50€ banknote. The 500 € banknote is not issued.<br>The printer code is not used anymore. The printing facility is indicated by the first character of the serial number, see <a href="/data/euroarea/euro/serial-number-codes.html" target="_blank" style="text-decoration: none"><b>Printer Codes</b></a><br>See <a href="/data/euroarea/euro/the_first_euros_2015en.pdf" target="_blank" style="text-decoration: none"><b>"The first Euros"</b></a><br> ', NULL);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (5, 74, 'First Series', 2002, 2012, 2, NULL, 'The main theme is the European architecture throughout its history.The banknotes obverse features arches or gateways with the European flag in the upper left corner. To its right the acronyms of the European Central Bank in five languages. Below these acronyms, the signature of the ECB president. A printer code is located at different positions of each denomination, see  Printer Codes.The banknotes reverse shows different types of bridges and a map of Europe, including the Azores, Madeira and the Canary Islands, plus French Guiana, Guadeloupe, Martinique and Réunion in small boxes. The serial number appears twice. The first character of the serial number uniquely identifies the issuing country, see Issuing Country CodesSee "The first Euros"', NULL);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (3, 72, 'Juan Carlos I, first issue', 1978, 1978, 1, NULL, 'This series includes only the new 5000 pesetas denomination, already designed and planned before the death of dictator Franco.', NULL);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (2, 72, 'Juan Carlos I, second issue', 1982, 1987, 1, NULL, 'First complete series of banknotes under the reign of Juan Carlos I. If introduces the pattern 1 - 2 - 5 (starting with 200 pesetas)', NULL);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (1, 72, 'Juan Carlos I, third issue', 1993, 1995, 1, NULL, 'Last series of the Spanish peseta banknotes. It does not include 200 or 500 pesetas, which were already issued as coins.
