INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (129, 5, 3, 'MV', 'MDV', 'Maldives', 'Republic of Maldives', 1965, NULL, NULL, NULL, NULL);
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (330, 5, 3, NULL, NULL, 'Malaya', 'Federation of Malaya', 1957, 1963, NULL, '128', 'The Federation became independent on 31 August 1957, and in 1963, Malaysia was formed when the federation united with the colonies of Singapore, North Borneo, and Sarawak.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (331, 5, 5, NULL, NULL, 'Malaya', 'Federation of Malaya', 1948, 1957, 224, '330', 'Federation of British Malaya, comprising eleven states (nine Malay states and two of the British Straits Settlements, Penang and Malacca) that existed from 1 February 1948 until 16 September 1963. The Federation became independent on 31 August 1957.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (332, 5, 5, NULL, NULL, 'North Borneo', 'Crown Colony of North Borneo', 1946, 1963, 224, '128', 'The Crown Colony of Labuan joined the new Crown Colony during its formation. It was succeeded as the state of Sabah through the formation of the Federation of Malaysia on 16 September 1963.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (333, 5, 5, NULL, NULL, 'Sarawak', 'Crown Colony of Sarawak', 1946, 1963, 224, '128', 'The Crown Colony of Sarawak was a British Crown colony on the island of Borneo, established in 1946, shortly after the dissolution of the British Military Administration. It was succeeded as the state of Sarawak through the formation of the Federation of Malaysia on 16 September 1963.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (334, 5, 5, NULL, NULL, 'Singapore', 'Colony of Singapore', 1946, 1963, 224, '128', 'The Colony of Singapore was a British Crown colony that existed from 1946 until 1963. In 1946, the Straits Settlements were dissolved and Singapore together with the Cocos-Keeling and Christmas Island became a separate Crown colony. The colony was governed by the United Kingdom until it gained partial internal self-governance in 1955. The Crown colony was dissolved on 16 September 1963 when Singapore became a state of Malaysia. On 9 August 1965, Singapore officially left Malaysia to become the independent Republic of Singapore');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (335, 5, 2, NULL, NULL, 'Malaya and British Borneo', 'Malaya and British Borneo', 1953, 1967, NULL, NULL, 'The Malaya and British Borneo dollar was the currency of Malaya, Singapore, Sarawak, North Borneo, Brunei and Riau archipelago from 1953 to 1967 and was the successor of the Malayan dollar and Sarawak dollar, replacing them at par. The currency was issued by the Board of Commissioners of Currency, Malaya and British Borneo. Prior to 1952, the board was known as the Board of Commissioners of Currency, Malaya. 
